import React, {useState, useEffect} from 'react';
import styled from 'styled-components';

//icons
import {FaCloudShowersHeavy, FaGasPump} from 'react-icons/fa'

//images
import default_img from '../assets/default_image.png'


const Styles = styled.div`
   padding : 0 8%;
   box-shadow:0 20px rgba(0,0,0, 0.253);
`;

const Card_pneu = styled.div`
    display:flex;
    flex-direction: row;
    box-shadow:5px 10px 20px 1px rgba(0,0,0, 0.253);
    background:#F5F5F5;
    border-radius:10px;
    margin-top: 1% ;
    padding:2% 0;

    .card-img{
        display:flex;
        flex-direction:column;
        width:15%;
    }
    .default-img{
        height:100%;
        color:#333;
    }
    .card-info-1{}
    .card-info-2{}
`;

function SearchResult(props){
    return(
        <React.Fragment>
            <Styles>
                <h5>Notre selection de pneus : {props.dimensions.largeur}/{props.dimensions.hauteur} R{props.dimensions.diametre} {props.dimensions.charge}</h5>
                <hr/>
                {props.resultat.map( (res) => 
                <Card_pneu>
                    <div className='card-img'>
                          {res.marque_img === null ? null :
                          <img
                          src={`https://www.monsterstudio.org${res.marque_img}`}
                          width='150'
                          height='30'
                        />
                          }
                        {res.image_url === null ? 
                        <div className='default-img'>
                           <img
                            src={`${default_img }`}
                            width='150'
                            height='200'
                            className='image'
                           />
                           <div className="overlay">
                                <div className="text">Image Non Disponible</div>
                            </div>
                        </div>
                         :
                        <img
                            src={`https://www.monsterstudio.org${res.image_url}`}
                            width='150'
                             height='200'
                        />
                        }
                    </div>
                    <div className='card-info-1'>
                       <p>{props.dimensions.largeur}/{props.dimensions.hauteur} R{props.dimensions.diametre} {props.dimensions.charge}</p>
                       <p>categorie : {res.type}</p>
                       <div className='card-info-2'>
                          <FaGasPump/>
                          <FaCloudShowersHeavy/>
                       </div>
                    </div>
                </Card_pneu>
                )}            
        </Styles>
        </React.Fragment>
    )
}

export default SearchResult;

